import React, { FC } from "react";
import "./Glooyot.css";
import { Glooya } from "../../components";

type GlooyotProps = {
  data: any;
  deleteID: (documentId: string) => Promise<void>;
  setEditedGlooya: any;
  setEditGlooyaOpen: any;
};

const Glooyot: FC<GlooyotProps> = ({
  data,
  deleteID,
  setEditedGlooya,
  setEditGlooyaOpen,
}) => {
  return (
    <div className="glooyot-wrapper">
      {data?.map((glooya: any, i: any) => (
        <Glooya
          glooya={glooya}
          key={i}
          deleteID={deleteID}
          setEditedGlooya={setEditedGlooya}
        />
      ))}
    </div>
  );
};

export default Glooyot;
